import { createRouter, createWebHashHistory } from 'vue-router';
import WelcomeView from '@/views/WelcomeView.vue';

const routes = [
  {
    path: "/",
    name: "welcome",
    component: WelcomeView,
  },
  {
    path: '/login',
    name: 'login',
    component: LoginView
  }
];

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
